import React, { Component } from 'react';
import ShoppingItems from '../data/ShoppingItems.json'

export class Home extends Component {
    render() {

        const data = this.state.ShoppingItems;

        return (
            <div>
                <h1>Hello world</h1>
                {data.phones[1]}
            </div>
        )
    }
}

export default Home;
